script: |
  super -f text -I q46.spq | sort > q46.out

inputs:
  - name: q46.spq
    data: |
      SELECT ALL + + ( + 35 ) AS col1 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT - col1 * - - col0 * - + col1 * - col0 NOT BETWEEN col1 AND + col0 / 54;
  - name: tab0

outputs:
  - name: q46.out
    data: |
